import React from 'react';

import PlanetCard from '../components/PlanetCard/PlanetCard';

import * as S from './indexStyles';

function HomePage() {
  return (
    <S.Main>
      <PlanetCard name="Tatooine" image="/tatooine.jpeg" url="/planets/tatooine" />
      <PlanetCard name="Alderaan" image="/alderaan.jpeg" url="/planets/alderaan/" />
      <PlanetCard name="Yavin" image="/yavin.jpeg" url="/planets/yavin" />
    </S.Main>
  );
}

export default HomePage;
